To determine whether a given integer \( n \) is a power of three, you can use the mathematical property that a number is a power of three if and only if it can be written in the form \( 3^x \) where \( x \) is an integer. 

A more efficient way to check this is by using the logarithm. If \( n \) is a power of three, then there exists an integer \( x \) such that \( 3^x \) is a factor of \( n \). 

Here's a Java solution for this problem:

```java
public class PowerOfThree {

    public static boolean isPowerOfThree(int n) {
        // Edge case: n should be non-negative
        if (n < 0) {
            return false;
        }

        // The only way n can be a power of three is if it's 3 itself
        return n == 3;
    }

    public static void main(String[] args) {
        // Test cases
        System.out.println(isPowerOfThree(27)); // true
        System.out.println(isPowerOfThree(0));    // false
        System.out.println(isPowerOfThree(-1));  // false
    }
}
```

### Explanation:
1. **Edge Case Handling**: The function first checks if \( n \) is negative. If it is, the function returns `false` immediately because negative numbers cannot be powers of three.

2. **Direct Check**: The function then checks if \( n \) is equal to 3 directly. If \( n \) is 3, then it is a power of three.

This approach is efficient because it avoids the need for loops or recursion, and directly answers the question using the mathematical property of powers of three.

